Detaches a port forwarding rule from a server.
Arguments



Input parameter
Type
Required
Description




portForwardingConfigurationNo
string
optional
The value to create port forwarding rule based on the region. (Default: the port forwarding config number of the region you chose )  It can be obtained from findPortForwardingRules method(action getPortForwardingRuleList). It can vary depending on regionNo.


serverInstanceNo
string
required
Unique number of a server for where to forward.


externalPort
string
required
External port to access the server via SSH.


internalPort
string
required
Destination port. Choose either 22 or 3389. Values other than these are invalid.



Example
client.compute.destroyPortForwardingRule({ serverInstanceNo: 507498, externalPort: 52273, internalPort: 22 }, function( err, rules ) {
  if ( err ) {
     return console.log( err.message );
   }

  // list port forwarding rules like the result of findPortForwardingRules method.
  console.log( rules );

  // It is possible to wait for the detached rule completely if needed.
  rules.setWait({},function(err, rules) {
    if ( err ) {
      return console.log( err.message );
    }
    console.log( rules );
  })
})

