createServer, action createServerInstances
Creates a server with the options specified.
Returns the server in the callback f(err, server);
Arguments
 Tip: Choose either vmImageId or privateImageNo for VM configuration. 



Input parameter
Type
Required
Description




vmImageId
string
conditional
Unique Id of a public image that can be got from findPublicImages method(action getServerImageProductList). If privateImageNo is used, this argument is not available and vice versa.


privateImageNo
string
conditional
Unique No of a private image that you have built. It can be got from findPrivateImages method(action getMemberServerImageList). If vmImageId is used, this argument is not available and vice versa.


vmFlavorId
string
optional
an Id for one of VM hardware templates. It can be got from findFlavors method(action getServerProductList).


serverName
string
optional
name for the resulting server.


serverDescription
string
optional
description for the resulting server.


loginKeyName
string
optional
The name of loginKey that is used for public key encryption. List of loginKeys can be got from findLoginKeys method(action getLoginKeyList).


feeSystemTypeCode
string
optional
either MTRAT or FXSUM(default MTRAT)  MTRAT: Hourly rate pricing.  FXSUM: Fixed rate pricing per month.


zoneNo
number
optional
zone number to determine which zone the resulting VM will be located in. List of zones can be got from findZones method(action getZoneList).


accessControlGroupConfigurationNoList
number[]
optional
The number list for predefined firewall configurations. That can be got from findAccessControlGroup method(getAccessControlGroupList action). Length of list can be up to 5.


userData
string
optional
When first startup, VM executes userData. Linux: Python, Perl, Shell and etc are available.  At the beginning of script, there must be executable environment such as #!/usr/bin/env python, #!/bin/perl and #!/bin/bash.  Windows: Visual Basic script is available only.  [Script should be written in English]



